import React, { Component } from "react";
import "./App.css";
import { Layout, Header, Navigation, Drawer, Content } from "react-mdl";
// import Navbar from "./components/Navbar/Navbar";

class App extends Component {
  render() {
    return (
      <div className="demo-big-content">
        <Layout>
          <Header waterfall>
            <HeaderRow title="Title">
              {/* <Textfield
                value=""
                onChange={() => {}}
                label="Search2"
                expandable
                expandableIcon="search"
              /> */}
            </HeaderRow>
            <HeaderRow>
              <Navigation>
                <a h>Link</a>
                <a h>Link</a>
                <a h>Link</a>
                <a h>Link</a>
              </Navigation>
            </HeaderRow>
          </Header>
          <Drawer title="Title">
            <Navigation>
              <a h>Link</a>
              <a h>Link</a>
              <a h>Link</a>
              <a h>Link</a>
            </Navigation>
          </Drawer>
          <Content>
            <div className="page-content" />
          </Content>
        </Layout>
      </div>
    );
  }
}

export default App;
